member.example:
下例演示如何实现多图层不同查询条件的查询操作。


            [C#]

            		private void btnSQLQuery_Click(object sender, System.EventArgs e)
            		{
            			QueryParam queryParam = new QueryParam();
            			QueryLayer queryLayer1 = new QueryLayer();
            			queryLayer1.Name = "World@World";          //设置第一个查询图层的名称
            			queryLayer1.ReturnFields = new string[1];  
            			queryLayer1.ReturnFields[0] = "SmID";      //设置第一个查询图层的返回字段
            			queryLayer1.WhereClause = "SmID = 216";    //设置第一个查询图层的查询条件
            			QueryLayer queryLayer2 = new QueryLayer(); 
            			queryLayer2.Name = "Grid@World";           //设置第二个查询图层的名称
            			queryLayer2.ReturnFields = new string[1];  
            			queryParam2.ReturnFields[0] = "Name";      //设置第二个查询图层的返回字段
            			queryLayer2.WhereClause = "SmID = 10";     //设置第二个查询图层的查询条件
            			queryparam.Layers = new QueryLayer[2];
            			queryParam.Layers[0] = queryLayer1; 
            			queryParam.Layers[1] = queryLayer2; 
            			ResultSet resultSet = this.MapControl1.QueryBySql(queryParam);
            			ShowQueryResult(resultSet);
            		}

