注：如果需要使用下面的示例代码，请先添加对 Utility 命名空间的引用：
using SuperMap.IS.Utility;

//设置点选查询的点坐标
MapCoord querypoint = new MapCoord(8100, -5700);
//将地理坐标转为象素坐标
int pointTolerance = SuperMap.IS.Utility.Convertor.MapDistanceToPixelDistance(500, MapControl1.GetCurrentMapParam()); 
MapControl1.PointTolerance = pointTolerance;

//设置查询参数
QueryParam param = new QueryParam();
param.HasGeometry = true;
param.IsAllLayer = false;

//设置查询的2个图层
param.Layers = new QueryLayer[2];
param.Layers[0] = new QueryLayer();
param.Layers[1] = new QueryLayer();
param.Layers[0].Name = "RoadLine2@changchun";
param.Layers[1].Name = "RoadLine3@changchun";

//设置第1种高亮显示风格，高亮颜色为绿色
Highlight highlight1 = new Highlight();
highlight1.LineStyle = new SuperMap.IS.Utility.Style();
highlight1.LineStyle.PenColor = System.Drawing.ColorTranslator.ToOle(Color.FromArgb(0, 255, 0));
highlight1.LineStyle.PenWidth = 10;

//设置第2种高亮显示风格，高亮颜色为红色
Highlight highlight2 = new Highlight();
highlight2.LineStyle = new SuperMap.IS.Utility.Style();
highlight2.LineStyle.PenColor = System.Drawing.ColorTranslator.ToOle(Color.FromArgb(255, 0, 0));
highlight2.LineStyle.PenWidth = 15;

//对2个图层分别采用2种不同的高亮显示风格
param.Layers[0].Highlight = highlight1;
param.Layers[1].Highlight = highlight2;

//点选查询
ResultSet rs = MapControl1.QueryByPoint(querypoint, param);

