member.example:
下面的示例代码为设置可变步长的等值距数组以提取等值面的操作。其中基准值以及Intervals都在高程值范围之内，最后一个值大于栅格最大的高程值时，提取的等值面以最大高程值为准。

protected void BtnIsoRegion_Click(object sender, EventArgs e)
{
    //设置等值距数组以提取等值面
    IsoRegionParam isoRegionParam = new IsoRegionParam(1200, new double[] { 50, 6, 2000 });
    isoRegionParam.OverwriteIfExists = true;
    //结果数据集名称
    isoRegionParam.ResultDataset = "result@dem";
    //等值面光滑度
    isoRegionParam.Smoothness = 3;
    //要进行提取等值面操作的栅格数据集
    isoRegionParam.GridDataset = "DEM@dem";
    //使用Intervals可变的间距步长提取等值面
    isoRegionParam.UseIntervals = true;
    //提取等值面
    IsoRegionResult actualresult = MapControl1.GridAnalystOperator.IsoRegion(isoRegionParam);
}

