protected void Button1_Click(object sender, EventArgs e)
   {
     Layer layer = new Layer();
     int intLayerCount = MapControl1.Layers.GetUpperBound(0) - MapControl1.Layers.GetLowerBound(0);
     for (int i = 0; i <intlayerCount; i++)
        {
           if (MapControl1.Layers[i].Type == LayerType.Polygon)
             {
                layer = MapControl1.Layers[i]; // 获取一个面图层
                break;
             }
        }
     if (layer == null)
       { 
          return;
       }
     if (layer.ThemeRange == null) //判断该图层是否已经有范围分段专题图
       {
          layer.ThemeRange = new SuperMap.IS.Utility.RangeTheme();
       }
     SuperMap.IS.Utility.RangeTheme theme = layer.ThemeRange;
     theme.Enabled = true; // 开始制作专题图
     theme.Caption = "Range";
     theme.Expression = "SmID"; // 设置专题变量
     // 设置分段范围
     theme.BreakValues = new Double[4];
     theme.BreakValues[0] = 20;
     theme.BreakValues[1] = 40;
     theme.BreakValues[2] = 60;
     theme.BreakValues[3] = 80;
     // 设置每段显示风格
     theme.Displays = new SuperMap.IS.Utility.Style[5];
     theme.Displays[0] = new SuperMap.IS.Utility.Style();
     theme.Displays[1] = new SuperMap.IS.Utility.Style();
     theme.Displays[2] = new SuperMap.IS.Utility.Style();
     theme.Displays[3] = new SuperMap.IS.Utility.Style();
     theme.Displays[4] = new SuperMap.IS.Utility.Style();
     theme.Displays[0].BrushColor = 65535;
     theme.Displays[1].BrushColor = 255;
     theme.Displays[2].BrushColor = 16711680;
     theme.Displays[3].BrushColor = 846;
     theme.Displays[4].BrushColor = 2445866;
     MapControl1.Update(); // 更新地图
  }


[C#]

   protected void Button1_Click(object sender, EventArgs e)
     {
       Layer layer = new Layer();
       int intLayerCount = MapControl1.Layers.GetUpperBound(0) - MapControl1.Layers.GetLowerBound(0);
       for (int i = 0; i < intLayerCount; i++)
         {
          if (MapControl1.Layers[i].Type == LayerType.Polygon)
            {
              layer = MapControl1.Layers[i]; // 获取一个面图层
              break;
            }
         }
       if (layer == null)
        {
          return;
        }
       if (layer.ThemeDotDensity == null) // 判断该图层是否已经有点密度专题图
        {
          layer.ThemeDotDensity = new SuperMap.IS.Utility.DotDensityTheme();
        }
       SuperMap.IS.Utility.DotDensityTheme theme = layer.ThemeDotDensity;
       theme.Enabled = true; // 开始做专题图
       theme.Caption = "aaa";
       theme.Expression = "SMArea"; // 设置专题变量
       theme.DotValue = 100; // 设置每个点表达的数值
       // 设置点符号的风格
       theme.DotStyle = new SuperMap.IS.Utility.Style(); 
       theme.DotStyle.PenColor = 255;
       theme.DotStyle.SymbolSize = 20;
       theme.DotStyle.SymbolStyle = 1180;
       this.MapControl1.Update(); // 更新地图
     }


