 protected void Button1_Click(object sender, EventArgs e)
  {
     Layer layer = new Layer();
     int intLayerCount = MapControl1.Layers.GetUpperBound(0) - MapControl1.Layers.GetLowerBound(0);
     for (int i = 0; i < intLayerCount; i++)
      {
       if (MapControl1.Layers[i].Type == LayerType.Polygon)
         {
            layer = MapControl1.Layers[i]; // 获取一个面图层
            break;
         }
      }
      if (layer == null)
       {
          return;
       }
      if (layer.ThemeGraduatedSymbol == null) //判断该图层是否已经有等级符号专题图
       {
          layer.ThemeGraduatedSymbol = new　SuperMap.IS.Utility.GraduatedSymbolTheme();
       }
       SuperMap.IS.Utility.GraduatedSymbolTheme gsTheme = layer.ThemeGraduatedSymbol;
       gsTheme.Caption = "gs3";
       gsTheme.Enabled = true; // 开始制作专题图
       gsTheme.ShowNegative = true;
       gsTheme.Expression = "SmID"; // 设置专题变量
       gsTheme.DefinitionValue = 2;
       gsTheme.GraduatedMode = GraduatedMode.Constant; // 设置划分等级计算模式
       // 设置符号风格
       if (gsTheme.StyleForPositive == null)
        {
          gsTheme.StyleForPositive = new SuperMap.IS.Utility.Style();
          gsTheme.StyleForPositive.BrushColor = 65535;
          gsTheme.StyleForPositive.PenColor = 65535;
          gsTheme.StyleForPositive.SymbolSize = 1;
          gsTheme.StyleForPositive.SymbolStyle = 1180;
        }
       if (gsTheme.StyleForNegative == null)
       {
         gsTheme.StyleForNegative = new SuperMap.IS.Utility.Style();
         gsTheme.StyleForNegative.BrushColor = 255;
         gsTheme.StyleForNegative.PenColor = 255;
         gsTheme.StyleForNegative.SymbolStyle = 1180;
         gsTheme.StyleForNegative.SymbolSize = 1;
       }
       this.MapControl1.Update(); // 更新地图
    }


[C#]

 		protected void Button1_Click(object sender, System.EventArgs e)
		{
		    int length = this.MapControl1.Layers.Length ;
		    int j = 0 ;
		    Layer[] layers = this.MapControl1.Layers;
		    for(int i = 0 ;i <= length ;i++)
