[VB.NET]

Private Sub Button1_Click(ByVal sender As System.Object, ByVal e As System.EventArgs) Handles Button1.Click
        Dim length As Integer = Me.MapControl1.Layers.Length
        Dim j As Integer = 0
        For i As Integer = 0 To length
        If MapControl1.Layers(i).Name = "World@world" Then
             j = i
        End If
        Next
        Dim objLayer As Layer = MapControl1.Layers(j)
        If objLayer Is Nothing Then
              Exit Sub
        End If
        If objLayer.ThemeGraph Is Nothing Then
               objLayer.ThemeGraph = New GraphTheme
        End If
        Dim theme As GraphTheme = objLayer.ThemeGraph
        theme.Enabled = True
        theme.Caption = "abc"
        theme.Expressions = New String(2) {}
        theme.Expressions(0) = "Pop_1994"
        theme.Expressions(1) = "SmArea"
        theme.GraphStyles = New SuperMap.IS.Utility.Style(2) {}
        theme.GraphStyles(0) = New SuperMap.IS.Utility.Style
        theme.GraphStyles(1) = New SuperMap.IS.Utility.Style
        theme.GraphStyles(0).BrushColor = 255
        theme.GraphStyles(1).BrushColor = 65535
        theme.GraphType = GraphType.Pie3D
         Me.MapControl1.Update()
   End Sub

