geoRect.Feature = FeatureType.Polygon;  // 设置绘制的几何对象的类型为多边形
geoRect.Parts = new int[1] { 5 };       // 设置几何对象为一个简单的对象并且通过5个简单点来确定形状
geoRect.Points = new MapCoord[5];
geoRect.Points[0] = new MapCoord(3700, -4000);
geoRect.Points[1] = new MapCoord(3700, -4300);
geoRect.Points[2] = new MapCoord(4000, -4300);
geoRect.Points[3] = new MapCoord(4000, -4000);
geoRect.Points[4] = new MapCoord(3700, -4000);  // 首尾相接

VB .NET

Dim geoRect As New Geometry
geoRect.Feature = FeatureType.Polygon   ' 设置绘制的几何对象的类型为多边形
geoRect.Parts = New Integer(1) {}       ' 设置几何对象为一个简单的对象并且通过5个简单点来确定形状
geoRect.Parts(0) = 5
geoRect.Points = New MapCoord(5) {}
geoRect.Points(0) = New MapCoord(3700, -4000)
geoRect.Points(1) = New MapCoord(3700, -4300)
geoRect.Points(2) = New MapCoord(4000, -4300)
geoRect.Points(3) = New MapCoord(4000, -4000)
geoRect.Points(4) = New MapCoord(3700, -4000)  ' 首尾相接

member.example:
下面的示例代码为设置可变步长的等值距数组以提取等值线的操作。其中基准值和 intervals 都在高程值范围之内，当最后一个值大于栅格最大的高程值时，提取的等值线以最大高程值为准。

protected void BtnIsoline_Click(object sender, EventArgs e)
{
    //设置等值距数组以提取等值线
    IsoLineParam isoLineParam = new IsoLineParam(1200, new double[] { 50, 6, 20000 });
    isoLineParam.OverwriteIfExists = true;
    //结果数据集名称
    isoLineParam.ResultDataset = "result@dem";
    //等值线光滑度
    isoLineParam.Smoothness = 3;
    //将等值线结果保存在指定的数据集中
    isoLineParam.SaveResultToDataset = true;

    //提取等值线
    IsoLineResult actualresult = MapControl1.GridAnalystOperator.IsoLine("DEM@dem", isoLineParam);
}
